import { json } from "body-parser";
import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const item=[];

    const noticePage = () =>{
        window.location.href='/todo';
    }

    useEffect(()=>{
        apiGet();  
    },[])
    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>{
            setData(json);
            for(let i=0;i<json.user.length;i=i+1){
                item.push(json.user[i]);
                console.log(json.user[i].name);
            }
        })
    }


    return (

        <div>
      <h1>Featured Products</h1>
      <div >
            {JSON.stringify(data.user[0],null,2)}
            <button onClick={noticePage}></button>
      </div>
    </div>
    )
}

export default Todo

